import React, { Component } from "react";
export default class DocumentTemp extends Component {
  constructor(props) {
    super(props);
    this.state = {
      TempData: [],
    };
  }
  componentDidMount() {
    const { data } = this.props;
    let token = data[0].User.access_token;
    console.log(token);
    fetch(
      "https://api.revvsales.com/api/docstemplate/?page_num=1&status=ACTIVE",
      {
        method: "GET",
        headers: {
          "Content-Type": "application/json",
          AccessToken: token,
        },
      }
    )
      .then((response) => response.json())
      .then((data) => {
        this.setState({
          TempData: [data],
        });
      })
      .catch((error) => {
        this.setState({
          error: "Invalid Email or Password",
        });
      });
  }
  render() {
    console.log(this.state.TempData);

    return (
      <>
        {this.state.TempData.length > 0 ? (
          <div>
            {this.state.TempData[0].Templates.map((a) => (
              <div>
                <div>{a.created_by.image_url}</div>
                <div>{a.title}</div>
              </div>
            ))}
          </div>
        ) : (
          <></>
        )}
      </>
    );
  }
}
